import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Layout from "./layout/Layout";
import AllTasks from "./pages/AllTasks.js";
import "./scss/main.scss";

const App = () => {
  return (
    <Layout>
      <BrowserRouter>
        <Switch>
          <Route path="/" exact>
            Hello!
          </Route>
          <Route path="/tasks" exact>
            <AllTasks />
          </Route>
        </Switch>
      </BrowserRouter>
    </Layout>
  );
};

export default App;
